import React from "react";
import "../App.css";

function ListItem(props) {
  return (
    <React.Fragment>
      <img className = "Image" src = {props.avatar} />
      <div>
      <p className = "Name">Name - {props.name}</p>
      <p>City - {props.city}</p>
      <p>Email- {props.email}</p>
      <p>birthday - {props.birthday}</p> 
        </div>

    </React.Fragment>
  );
}

export default ListItem;
